import React from 'react';
import ReactPlayer from "react-player";


function Reviews() {
  return (
    <div>
        <h1>Recent Reviews of Our Alumni</h1>
        <div className='flex'>
            <ReactPlayer url="https://www.youtube.com/watch?v=Ev739wXDMWg"/>
            <ReactPlayer url="https://www.youtube.com/watch?v=f8C9LD66BSo"/>
        </div>
    </div>
  )
}

export default Reviews
